import React from 'react'
import {useDispatch, useSelector} from 'react-redux'
import {obtermAccion} from 'C:/Users/d_b_o/Desktop/dev_dan/r_m/src/redux/r_mDucks'

const Body = () =>{
    const dispatch = useDispatch ()
    const personaje = useSelector (store => store.personajes.array)

  return (
    <div>
               { window.onload= () => dispatch (obtermAccion()) }
                <div className='row' >
                  { personaje.map(per => {
                      return( 
                        <div  className='col'>
                          <div  className='card'>
                            <img src={per.image} alt="" />
                              <h5 className=' mt-2' key={per.id}>
                                  Nombre: {per.name}
                              </h5>
                              <h5>
                                  Especie: {per.species}
                              </h5>
                              <h5>
                                Estado : {per.status}
                              </h5>
                          </div>

                        </div>
                  )})
                  }
        </div>
    </div>
  )
}

export default Body;
